DROP TABLE IF EXISTS `members`;

CREATE TABLE IF NOT EXISTS `members` (
  `id` int(11) NOT NULL,
  `password` varchar(200) COLLATE utf8_unicode_ci NOT NULL,
  `password_hint` varchar(200) COLLATE utf8_unicode_ci NOT NULL,
  `member_type_id` int(11) NOT NULL,
  `parent_id` int(11) DEFAULT NULL,
  `lft` int(11) DEFAULT NULL,
  `rght` int(11) DEFAULT NULL,
  `courses` varchar(250) COLLATE utf8_unicode_ci NOT NULL,
  `finance_type_id` int(11) NOT NULL,
  `payment_type_id` int(11) NOT NULL,
  `company` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `vat_no` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `registration_no` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `title_id` int(11) NOT NULL,
  `first_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `last_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `id_number` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `passport_number` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `gender_id` int(11) NOT NULL,
  `race_id` int(11) NOT NULL,
  `date_of_birth` date NOT NULL,
  `employer` varchar(150) COLLATE utf8_unicode_ci NOT NULL,
  `occupation` varchar(150) COLLATE utf8_unicode_ci NOT NULL,
  `work_tel` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `home_tel` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `fax` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `mobile` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `email` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `physical_address` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `physical_address_code` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `postal_address` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `postal_address_code` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `delivery_address` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `delivery_address_code` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `province_id` int(11) NOT NULL,
  `city` varchar(256) COLLATE utf8_unicode_ci DEFAULT NULL,
  `terms_and_conditions` int(1) DEFAULT NULL,
  `statement` tinyint(1) NOT NULL DEFAULT '1',
  `status_id` int(11) NOT NULL DEFAULT '1',
  `last_login_date` datetime NOT NULL,
  `created` datetime DEFAULT NULL,
  `created_by` int(11) DEFAULT '0',
  `modified` datetime DEFAULT NULL,
  `modified_by` int(11) DEFAULT '0'
) ENGINE=InnoDB AUTO_INCREMENT=1304 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

